import { useState } from "react";
function Password(props) {

    const {delta} = props
    const [passVal,setPass] = useState('')

    function PassSrrength(){
        setPass(function(passVal){
        if(delta < 100){
            passVal =  "weak";
        }
        if(delta >= 100 && delta <= 1000000) {
            passVal =  "medium"
        }
        if(delta > 1000000){
            passVal = "strong!"
        }
        
        return passVal
        }
        )
    }

  return (
    <div>
        <button onClick = {PassSrrength}> Passoword is {passVal}</button>
    </div>
  );
}

export default Password;
